import ParticlesBg from "particles-bg";

function TestSpace() {
    return(
        <div className="testLanding">
            <ParticlesBg type="circle" bg={true} style={{height:'100vh'}}/>
            <div className='Title'>
                Congratulations! You found my secret testing area.
            </div>
            <div className="message">
                There isn't really much for you to see here unless you 
                want to see what I am working on
            </div>
            <a href='/' className="downloadButton">Click here to return to the main page</a>
        </div>
    )
}

export default TestSpace;
